(335, 91, '', '+44', '7415238968', '+40', '733215281', 'office@sabytrans.co.uk', 'SabyTrans', 'https://www.sabytrans.co.uk', '', '', 'Adresa minima este Â£30 iar in afara Londrei este Â£34 ,indiferent de kg care le aveti pana in 20kg.\r\nPentru coletele expediate doar din Anglia catre Romania care se platesc in Romania, se va percepe o taxa suplimentara de ramburs de Â£5\r\nPentru preluarile si livrarile in  zonele rurale se  percepe o taxa suplimentara de Â£5\r\n\r\nTariful standard: Â£1.5 per KG pentru Londra si Â£1.7 in afara Londrei.\r\n\r\nTariful fix : â€‹Â£ 1 per Kg se aplica pentru clientii din aria de acoperire , la puncte fixe ,  dupa cum urmeaza : Oradea , Cluj , Satu Mare , Baia mare, Gherla, Dej , Bistrita , Jud Suceava.\r\nPentru coletele voluminoase (paturi, saltele, cutii foarte mari etc) se va face calcul volumetric.\r\nFormula de calcul a greutatii volumetrice este: (L)ungime x (l)atime x (h)inaltime(cm) impartit la 6000.\r\n\r\nDE RETINUT:\r\n\r\nPretul pe kg difera in functie de locatia dumneavoastra. Daca locuiti in Londra, este Â£1.5/kg iar daca locuiti in afara Londrei , pretul este Â£1,7/kg cu un minim de 20kg.\r\n', 'Clientii nostri beneficiaza de o reducere de 10% pentru colete cu greautatea peste 100KG.', '', 'Â£', '', '1.5', '', 'km', 'Packages;People;Auto;Pets;Moving', 'Packages;People;Moving', '2021-02-13 01:09:55'),
